import React from 'react'
import Project from '../Project'

const data = [
    {
        "title": "Project 1",
        "overview": "Overview 1",
        "githubLink": "gLink1",
        "deployedLink": "dLink1"
    },
    {
        "title": "Project 2",
        "overview": "Overview 2",
        "githubLink": "gLink2",
        "deployedLink": "dLink2"
    },
    {
        "title": "Project 3",
        "overview": "Overview 3",
        "githubLink": "gLink3",
        "deployedLink": "dLink3"
    },
    {
        "title": "Project 4",
        "overview": "Overview 4",
        "githubLink": "gLink4",
        "deployedLink": "dLink4"
    }
  ]

function Bootcamp() {
    return (
        <Project 
      title={data[0].title}
      overview={data[0].overview}
      githubLink={data[0].githubLink}
      deployedLink={data[0].deployedLink}
    />,
    <Project 
      title={data[1].title}
      overview={data[1].overview}
      githubLink={data[1].githubLink}
      deployedLink={data[1].deployedLink}
    />,
    <Project 
      title={data[2].title}
      overview={data[2].overview}
      githubLink={data[2].githubLink}
      deployedLink={data[2].deployedLink}
    />,
    <Project 
      title={data[3].title}
      overview={data[3].overview}
      githubLink={data[3].githubLink}
      deployedLink={data[3].deployedLink}
    />
    )
}

export default Bootcamp
